import React, { Component } from 'react';
import "./navbar.css";
import { Navbar, NavDropdown, Nav, Image } from "react-bootstrap";
import Logo from "../../assets/index.jpeg";
class Navbarweb extends Component {

    render() {
        return (
            <React.Fragment>

                <Navbar collapseOnSelect expand="lg" className="adjustnav">
                    <Navbar.Brand href="#home" ><span >  <Image src={Logo} width='145px' height='auto' /></span></Navbar.Brand>
                    {/* <Navbar.Toggle aria-controls="responsive-navbar-nav" />
                     */}
                    <button className="navbar-toggler" data-toggle="collapse" data-target="#makenav">
                        <span className="navbar-toggler-icon">

                        </span>
                    </button>
                    <div className="collapse navbar-collapse" id="makenav">


                        <ul className=" navbar-nav">
                            <li className="nav-item"><a className="nav-link">Home</a></li>
                            <li className="nav-item"><a className="nav-link">Home</a></li>
                            <li className="nav-item"><a className="nav-link">Home</a></li>
                            <li className="nav-item"><a className="nav-link">Home</a></li>
                        </ul>


                    </div>

                </Navbar>

            </React.Fragment >
        );
    }


}
export default Navbarweb;
